woningen.omschrijving:
Een 4-kamer appartement op de 10e verdieping. Gelegen in de wijk Kortland-Zuid. Dit appartement heeft een dichte keuken, een ruim balkon, dubbelglas, blokverwarming, en een boileraansluiting. In dit complex gelden woon- en leefregels. Er zijn complexbeheerders aanwezig met kantoor op de begane grond van de Vijverflat. Naast het kantoor bevindt zich tevens de ontmoetingsruimte Vijverhoek en een naschoolse opvang. Het openbaar vervoer, winkels, skatebaan en diverse basisscholen bevinden zich op loopafstand.<br />
<br />
De woning wordt voorzien van een vernieuwde badkamer, keuken en toilet.&nbsp;
